import React, { Component } from 'react';
import $ from 'jquery';
import './Login.css';
import lock from './lock.svg';
import { Link } from 'react-router-dom';

class Login extends Component {
    handleSubmit(e) {
        this.props.uname = document.getElementById("usr").value;
        this.props.mtime = document.getElementById("mt").value;
        $.ajax({
            url: 'http://localhost:8888/voinotesdb.php',
            type: 'GET',
            success: function (data) {
                console.log("Data returned by AJAX " + data);
            }.bind(this),
            error: function (xhr, status, err) {
                console.log("Error reported by AJAX " + err);
            }.bind(this)
        });
    }
    render() {
        return (
            <div className={"container"}>
                <div className={"jumbotron"}>
                    <div className="Login">
                        <header className="Login">
                            <img src={lock} id="lock" alt="lock"></img>
                            <center>
                                <p> Login </p>
                                <form action="#" method="POST">
                                    <input type="text" id="usr" name="user" placeholder="Username" /><br></br><br></br>
                                    Meeting Time: <input type="time" id="mt" name="mtime" min="9:00" max="20:00" /><br></br><br></br>
                                    {/* <input type="submit" name="submit" value="Start" className="btn btn-success" /> */}
                                    <Link to="/meeting/" className={"btn btn-success"} onClick={this.handleSubmit}>Start</Link>
                                </form>
                            </center>
                        </header>
                    </div>
                </div>
            </div>
        )
    }
}

export default Login;
